import React, {Component} from 'react';
import styled from "styled-components";
import 'bootstrap-icons/font/bootstrap-icons.css'

const Wrapper = styled.div`
    padding: 0.8rem;
    background-color: #ffffff;
    border: 1px solid #0A6466;
    border-radius: 15px;
    width: 29.5%;
    height: 100%;
`;

const NotificationTitle = styled.h3`
      font-family: Gilroy;
      font-weight: bold;
      font-size: 1em;
      color: #0A6466;
      margin: 0;
      padding: 0;
`;

const NotificationAuthor = styled.h3`
      font-family: Gilroy;
      font-weight: normal;
      font-size: 1em;
      color: #0A6466;
      margin: 0;
      padding: 0;
`;

class Notification extends Component {
    render() {
        return (
            <Wrapper>
                <NotificationTitle>Lorem Ipsum dolor Isemt</NotificationTitle>
                <NotificationAuthor>Lorem Ipsum</NotificationAuthor>
            </Wrapper>
        );
    }
}

export default Notification;
